merge_msgs(Prev, New)
    when element(1, Prev) =:= element(1, New) ->
    case Prev of
      #'saya.ingw.wafa.func.Ping'{} ->
	  'merge_msg_saya.ingw.wafa.func.Ping'(Prev, New);
      #'saya.ingw.wafa.type.Conversation'{} ->
	  'merge_msg_saya.ingw.wafa.type.Conversation'(Prev, New);
      #'saya.ingw.comn.type.Pong'{} ->
	  'merge_msg_saya.ingw.comn.type.Pong'(Prev, New);
      #'saya.ingw.comn.type.Done'{} ->
	  'merge_msg_saya.ingw.comn.type.Done'(Prev, New);
      #'saya.ingw.wafa.type.Board'{} ->
	  'merge_msg_saya.ingw.wafa.type.Board'(Prev, New);
      #'saya.ingw.wafa.type.Timeline'{} ->
	  'merge_msg_saya.ingw.wafa.type.Timeline'(Prev, New);
      #'saya.ingw.wafa.type.Message'{} ->
	  'merge_msg_saya.ingw.wafa.type.Message'(Prev, New);
      #'saya.ingw.wafa.func.DoSecurityCheck'{} ->
	  'merge_msg_saya.ingw.wafa.func.DoSecurityCheck'(Prev,
							  New);
      #'saya.ingw.comn.type.Failure'{} ->
	  'merge_msg_saya.ingw.comn.type.Failure'(Prev, New)
    end.

