								     =
								     NFMicroTimeStamp}) ->
    #'saya.ingw.wafa.func.Ping'{'MicroTimeStamp' =
				    if NFMicroTimeStamp =:= undefined ->
					   PFMicroTimeStamp;
				       true -> NFMicroTimeStamp
				    end}.

