					     undefined) ->
    Prev;
'merge_msg_saya.ingw.wafa.type.Conversation'(undefined,
					     New) ->
    New;
'merge_msg_saya.ingw.wafa.type.Conversation'(#'saya.ingw.wafa.type.Conversation'{'CID'
										     =
										     PFCID},
					     #'saya.ingw.wafa.type.Conversation'{'CID'
