verify_msg(Msg) ->
    case Msg of
      #'saya.ingw.wafa.func.Ping'{} ->
	  'v_msg_saya.ingw.wafa.func.Ping'(Msg,
					   ['saya.ingw.wafa.func.Ping']);
      #'saya.ingw.wafa.type.Conversation'{} ->
	  'v_msg_saya.ingw.wafa.type.Conversation'(Msg,
						   ['saya.ingw.wafa.type.Conversation']);
      #'saya.ingw.comn.type.Pong'{} ->
	  'v_msg_saya.ingw.comn.type.Pong'(Msg,
					   ['saya.ingw.comn.type.Pong']);
      #'saya.ingw.comn.type.Done'{} ->
	  'v_msg_saya.ingw.comn.type.Done'(Msg,
					   ['saya.ingw.comn.type.Done']);
      #'saya.ingw.wafa.type.Board'{} ->
	  'v_msg_saya.ingw.wafa.type.Board'(Msg,
					    ['saya.ingw.wafa.type.Board']);
      #'saya.ingw.wafa.type.Timeline'{} ->
	  'v_msg_saya.ingw.wafa.type.Timeline'(Msg,
					       ['saya.ingw.wafa.type.Timeline']);
      #'saya.ingw.wafa.type.Message'{} ->
	  'v_msg_saya.ingw.wafa.type.Message'(Msg,
					      ['saya.ingw.wafa.type.Message']);
      #'saya.ingw.wafa.func.DoSecurityCheck'{} ->
	  'v_msg_saya.ingw.wafa.func.DoSecurityCheck'(Msg,
						      ['saya.ingw.wafa.func.DoSecurityCheck']);
      #'saya.ingw.comn.type.Failure'{} ->
	  'v_msg_saya.ingw.comn.type.Failure'(Msg,
					      ['saya.ingw.comn.type.Failure']);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


'v_msg_saya.ingw.wafa.func.Ping'(#'saya.ingw.wafa.func.Ping'{'MicroTimeStamp'
								 = F1},
				 Path) ->
    v_type_fixed64(F1, ['MicroTimeStamp' | Path]), ok.

'v_msg_saya.ingw.wafa.type.Conversation'(#'saya.ingw.wafa.type.Conversation'{'CID'
										 =
										 F1},
					 Path) ->
    v_type_fixed64(F1, ['CID' | Path]), ok;
'v_msg_saya.ingw.wafa.type.Conversation'(X, Path) ->
    mk_type_error({expected_msg,
		   'saya.ingw.wafa.type.Conversation'},
		  X, Path).

'v_msg_saya.ingw.comn.type.Pong'(#'saya.ingw.comn.type.Pong'{'MicroTimeStamp'
								 = F1},
				 Path) ->
    v_type_fixed64(F1, ['MicroTimeStamp' | Path]), ok.

'v_msg_saya.ingw.comn.type.Done'(#'saya.ingw.comn.type.Done'{},
				 _Path) ->
    ok.

'v_msg_saya.ingw.wafa.type.Board'(#'saya.ingw.wafa.type.Board'{'BID'
								   = F1},
				  Path) ->
    v_type_fixed64(F1, ['BID' | Path]), ok;
'v_msg_saya.ingw.wafa.type.Board'(X, Path) ->
    mk_type_error({expected_msg,
		   'saya.ingw.wafa.type.Board'},
		  X, Path).

'v_msg_saya.ingw.wafa.type.Timeline'(#'saya.ingw.wafa.type.Timeline'{a
									 = F1},
				     Path) ->
    case F1 of
      undefined -> ok;
      {board, OF1} ->
	  'v_msg_saya.ingw.wafa.type.Board'(OF1,
					    [board, a | Path]);
      {conversation, OF1} ->
	  'v_msg_saya.ingw.wafa.type.Conversation'(OF1,
						   [conversation, a | Path]);
      _ -> mk_type_error(invalid_oneof, F1, [a | Path])
    end,
    ok;
'v_msg_saya.ingw.wafa.type.Timeline'(X, Path) ->
    mk_type_error({expected_msg,
		   'saya.ingw.wafa.type.Timeline'},
		  X, Path).

'v_msg_saya.ingw.wafa.type.Message'(#'saya.ingw.wafa.type.Message'{timestamp
								       = F1,
								   senderIID =
								       F2,
								   seq = F3,
								   timeline =
								       F4,
								   body = F5},
				    Path) ->
    v_type_fixed64(F1, [timestamp | Path]),
    v_type_fixed64(F2, [senderIID | Path]),
    v_type_int64(F3, [seq | Path]),
    'v_msg_saya.ingw.wafa.type.Timeline'(F4,
					 [timeline | Path]),
    v_type_string(F5, [body | Path]),
    ok;
'v_msg_saya.ingw.wafa.type.Message'(X, Path) ->
    mk_type_error({expected_msg,
		   'saya.ingw.wafa.type.Message'},
		  X, Path).

'v_msg_saya.ingw.wafa.func.DoSecurityCheck'(#'saya.ingw.wafa.func.DoSecurityCheck'{message
										       =
										       F1},
					    Path) ->
    if is_list(F1) ->
	   ['v_msg_saya.ingw.wafa.type.Message'(Elem,
						[message | Path])
	    || Elem <- F1];
       true ->
	   mk_type_error({invalid_list_of,
			  {msg, 'saya.ingw.wafa.type.Message'}},
			 F1, Path)
    end,
    ok.

'v_msg_saya.ingw.comn.type.Failure'(#'saya.ingw.comn.type.Failure'{code
								       = F1,
								   description =
								       F2},
				    Path) ->
    'v_enum_saya.ingw.comn.type.FailureCode'(F1,
					     [code | Path]),
    if F2 == undefined -> ok;
       true -> v_type_string(F2, [description | Path])
    end,
    ok.

'v_enum_saya.ingw.comn.type.FailureCode'('INTERNAL_SERVER_ERROR',
					 _Path) ->
    ok;
'v_enum_saya.ingw.comn.type.FailureCode'('INVALID_REQUEST',
					 _Path) ->
    ok;
'v_enum_saya.ingw.comn.type.FailureCode'(X, Path) ->
    mk_type_error({invalid_enum,
		   'saya.ingw.comn.type.FailureCode'},
		  X, Path).

v_type_int64(N, _Path)
    when -9223372036854775808 =< N,
	 N =< 9223372036854775807 ->
    ok;
v_type_int64(N, Path) when is_integer(N) ->
    mk_type_error({value_out_of_range, int64, signed, 64},
		  N, Path);
v_type_int64(X, Path) ->
    mk_type_error({bad_integer, int64, signed, 64}, X,
		  Path).

v_type_fixed64(N, _Path)
    when 0 =< N, N =< 18446744073709551615 ->
    ok;
v_type_fixed64(N, Path) when is_integer(N) ->
    mk_type_error({value_out_of_range, fixed64, unsigned,
		   64},
		  N, Path);
v_type_fixed64(X, Path) ->
    mk_type_error({bad_integer, fixed64, unsigned, 64}, X,
		  Path).

v_type_string(S, Path) when is_list(S); is_binary(S) ->
    try unicode:characters_to_binary(S) of
      B when is_binary(B) -> ok;
      {error, _, _} ->
	  mk_type_error(bad_unicode_string, S, Path)
    catch
      error:badarg ->
	  mk_type_error(bad_unicode_string, S, Path)
    end;
v_type_string(X, Path) ->
    mk_type_error(bad_unicode_string, X, Path).

mk_type_error(Error, ValueSeen, Path) ->
    Path2 = prettify_path(Path),
    erlang:error({gpb_type_error,
		  {Error, [{value, ValueSeen}, {path, Path2}]}}).


prettify_path([]) -> top_level;
prettify_path(PathR) ->
    list_to_atom(string:join(lists:map(fun atom_to_list/1,
				       lists:reverse(PathR)),
			     ".")).



